import React, { useState, useEffect } from 'react';
import '../styles/DbConnect.css';

const DbConnect = () => {
  const [engine, setEngine] = useState('');
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [host, setHost] = useState('');
  const [port, setPort] = useState('');
  const [database, setDatabase] = useState('');
  const [driver, setDriver] = useState('');
  const [encrypt, setEncrypt] = useState('');
  const [trustServerCertificate, setTrustServerCertificate] = useState('');

  const handleEngineChange = (e) => {
    setEngine(e.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Add submit logic here
  };

  return (
    <div>
      <div className="header">
        <h1>CEREBRO</h1>
      </div>
      <div className="container">
        <form id="dbConnectForm" onSubmit={handleSubmit}>
          <div className="form-field">
            <label htmlFor="engine">Engine:</label>
            <select name="engine" id="engine" value={engine} onChange={handleEngineChange}>
              <option value="">Select Database Engine</option>
              <option value="sqlserver">SQL Server</option>
              <option value="postgresql">PostgreSQL</option>
              <option value="oracle">Oracle</option>
              <option value="mysql">MySQL</option>
            </select>
          </div>

          {/* Repeat similar structure for other fields */}
          <div className="form-field">
            <label htmlFor="Username">Username:</label>
            <input type="text" id="Username" value={username} onChange={(e) => setUsername(e.target.value)} />
          </div>
          <div className="form-field">
            <label htmlFor="Password">Password:</label>
            <input type="Password" id="Password" value={password} onChange={(e) => setPassword(e.target.value)} />
          </div>
          <div className="form-field">
            <label htmlFor="host">Username:</label>
            <input type="text" id="host" value={username} onChange={(e) => setHost(e.target.value)} />
          </div>
          <div className="form-field">
            <label htmlFor="port">Password:</label>
            <input type="text" id="port" value={password} onChange={(e) => setPort(e.target.value)} />
          </div>
          <div className="form-field">
            <label htmlFor="Database Name">Username:</label>
            <input type="text" id="Database Name" value={username} onChange={(e) => setDatabaseName(e.target.value)} />
          </div>
          <div className="form-field">
            <label htmlFor="Driver">Password:</label>
            <input type="text" id="Driver" value={password} onChange={(e) => setDriver(e.target.value)} />
          </div>
          <div className="form-field">
            <label htmlFor="Encrypt">Engine:</label>
            <select name="Encrypt" id="Encrypt" value={engine} onChange={handleEngineChange}>
              <option value="Encrypt?">Encrypt</option>
              <option value="Yes">Yes</option>
              <option value="No">No</option>
            </select>
          </div>
          <div className="form-field">
            <label htmlFor="Trust Server Certificate">Engine:</label>
            <select name="Trust Server Certificate" id="Trust Server Certificate" value={engine} onChange={handleEngineChange}>
              <option value="Trust Server Certificate?">Trust Server Certificate</option>
              <option value="Yes">Yes</option>
              <option value="No">No</option>
            </select>
          </div>
          {/* ... other fields ... */}
          <button type="submit" className="submit-btn">Connect</button>
        </form>
      </div>
    </div>
  );
};

export default DbConnect;
